Create the pie/src/stamp.rs file and add: use std::fmt::Debug;
use std::io;
use std::path::Path;
use std::time::SystemTime; use crate::fs::metadata; #[derive(Copy, Clone, Ord, PartialOrd, Eq, PartialEq, Hash, Debug)]
pub enum FileStamper { Exists, Modified,
} impl FileStamper { pub fn stamp(&self, path: impl AsRef<Path>) -> Result<FileStamp, io::Error> { match self { FileStamper::Exists => { Ok(FileStamp::Exists(path.as_ref().try_exists()?)) } FileStamper::Modified => { let Some(metadata) = metadata(path)? else { return Ok(FileStamp::Modified(None)); }; Ok(FileStamp::Modified(Some(metadata.modified()?))) } } }
} #[derive(Copy, Clone, Ord, PartialOrd, Eq, PartialEq, Hash, Debug)]
pub enum FileStamp { Exists(bool), Modified(Option<SystemTime>),
} We're implementing FileStamper as an enum for simplicity. A FileStamper has a single method stamp which takes something that can be dereferenced to a path, and produces a FileStamp or an error if creating the stamp failed. For now, we implement only two kinds of file stampers: Exists and Modified. The Exists stamper just returns a boolean indicating whether a file exists. It can be used to create a file dependency where a task behaves differently based on whether a file exists or not. The Modified stamper returns the last modification date if the file exists, or None if the file does not exist. We derive Eq for stamps so that we can compare them. Equal (same) stamps indicate a consistent dependency, unequal (different) indicates inconsistent. We also derive Eq for stampers, because the stamper of a dependency could change, making the dependency inconsistent.

