We implement task output stampers in a similar way. Add to pie/src/stamp.rs: #[derive(Copy, Clone, Ord, PartialOrd, Eq, PartialEq, Hash, Debug)]
pub enum OutputStamper { Inconsequential, Equals,
} impl OutputStamper { pub fn stamp<O>(&self, output: O) -> OutputStamp<O> { match self { OutputStamper::Inconsequential => OutputStamp::Inconsequential, OutputStamper::Equals => OutputStamp::Equals(output), } }
} #[derive(Clone, Eq, PartialEq, Debug)]
pub enum OutputStamp<O> { Inconsequential, Equals(O),
} impl<O> OutputStamp<O> { pub fn as_ref(&self) -> OutputStamp<&O> { match self { OutputStamp::Inconsequential => OutputStamp::Inconsequential, OutputStamp::Equals(o) => OutputStamp::Equals(o), } }
} The Inconsequential stamper simply ignores the output and always returns the same stamp (thus is always equal). It can be used to create a task dependency where we are interested in some side effect of a task, but don't care about its output. The Equals stamper simply wraps the output of a task, so the stamp is equal when the output is equal. Output stamps are generic over the task output type O. Trait bounds and derive macros Because O is used in the enum, the derive attributes on OutputStamp create bounds over O. Thus, OutputStamp is only Clone when O is Clone, OutputStamp is only Eq when O is Eq, and so forth. Because we declared Task::Output with bound Clone + Eq + Debug, we can be sure that OutputStamp is always Clone, Eq, and Debug. User-defined stamps FileStamper and OutputStamper could also be a trait which would allow users of the library to implement their own stampers. For simplicity, we do not explore that option in this tutorial. If you feel adventurous, you could try to implement this after you've finished the tutorial. Do note that this introduces a lot of extra generics and trait bounds everywhere, which can be a bit cumbersome.

