Finally, we write some tests. Add to pie/src/stamp.rs: #[cfg(test)]
mod test { use std::fs::{remove_file, write}; use std::io; use dev_shared::create_temp_file; use super::*; #[test] fn test_exists_file_stamper() -> Result<(), io::Error> { let stamper = FileStamper::Exists; let temp_file = create_temp_file()?; let stamp = stamper.stamp(&temp_file)?; assert_eq!(stamp, stamper.stamp(&temp_file)?); remove_file(&temp_file)?; assert_ne!(stamp, stamper.stamp(&temp_file)?); Ok(()) } #[test] fn test_modified_file_stamper() -> Result<(), io::Error> { let stamper = FileStamper::Modified; let temp_file = create_temp_file()?; let stamp = stamper.stamp(&temp_file)?; assert_eq!(stamp, stamper.stamp(&temp_file)?); write(&temp_file, format!("{:?}", stamp))?; let new_stamp = stamper.stamp(&temp_file)?; assert_ne!(stamp, new_stamp); let stamp = new_stamp; remove_file(&temp_file)?; assert_ne!(stamp, stamper.stamp(&temp_file)?); Ok(()) } #[test] fn test_inconsequential_output_stamper() { let stamper = OutputStamper::Inconsequential; let stamp = stamper.stamp(&1); assert_eq!(stamp, stamper.stamp(&1)); assert_eq!(stamp, stamper.stamp(&2)); } #[test] fn test_equals_output_stamper() { let stamper = OutputStamper::Equals; let stamp = stamper.stamp(&1); assert_eq!(stamp, stamper.stamp(&1)); assert_ne!(stamp, stamper.stamp(&2)); }
} We test file stamps by creating a stamp, changing the file, creating a new stamp, and then compare the stamps. We test task output stamps by just passing a different output value to the stamp function, and then compare the stamps. Run cargo test to confirm the stamp implementation. If test test_modified_file_stamper fails, do continue to the next section, because we're going to fix it!

