Unfortunately, these tests may fail on some operating systems (Linux and Windows in my testing), due to an imprecise file last modified timer. What can happen is that we write to a file, making the OS update its modified time to 1000 (as an example, not a real timestamp), then very quickly write to the file again, making the OS update its modified time to 1000 again. Then, our test will fail because the stamp didn't change even though we expect it to change. This can happen with an imprecise timer that only increases once every millisecond (again, an example, not a real number) when we perform writes in between that millisecond. Even worse, our test can be flaky, sometimes succeeding if we write in between those milliseconds, sometimes failing if we write within a millisecond. To solve this, add a function to the filesystem testing utility crate. Change dev_shared/src/lib.rs: +use std::fs::{metadata, write}; use std::io;
+use std::path::Path;
+use std::time::SystemTime; use tempfile::{NamedTempFile, TempDir}; /// Creates a new temporary file that gets cleaned up when dropped. pub fn create_temp_file() -> Result<NamedTempFile, io::Error> { NamedTempFile::new() } /// Creates a new temporary directory that gets cleaned up when dropped. pub fn create_temp_dir() -> Result<TempDir, io::Error> { TempDir::new() }
+
+/// Keeps writing `contents` to file at `path` until its last modified time changes, then returns the modified time.
+/// This is required because some OSs have imprecise modified timers, where the file modified time does not change when +/// writing in quick succession.
+///
+/// # Errors
+///
+/// Returns an error when any file operation fails.
+pub fn write_until_modified(path: impl AsRef<Path>, contents: impl AsRef<[u8]>) -> Result<SystemTime, io::Error> {
+ let path = path.as_ref();
+ let contents = contents.as_ref();
+ fn get_modified(path: impl AsRef<Path>) -> Result<SystemTime, io::Error> {
+ let modified = match metadata(path) {
+ Err(e) if e.kind() == io::ErrorKind::NotFound => SystemTime::UNIX_EPOCH,
+ Err(e) => Err(e)?,
+ Ok(m) => m.modified()?
+ };
+ Ok(modified)
+ }
+ let modified = get_modified(path)?;
+ loop {
+ write(path, contents)?;
+ if modified != get_modified(path)? { break; }
+ }
+ Ok(modified)
+} The write_until_modified function writes to the file, but ensures its modified time will change. Now change the tests in pie/src/stamp.rs to use this function: #[cfg(test)] mod test {
- use std::fs::{remove_file, write};
+ use std::fs::remove_file; use std::io; - use dev_shared::create_temp_file;
+ use dev_shared::{create_temp_file, write_until_modified}; use super::*; #[test] fn test_exists_file_stamper() -> Result<(), io::Error> { let stamper = FileStamper::Exists; let temp_file = create_temp_file()?; let stamp = stamper.stamp(&temp_file)?; assert_eq!(stamp, stamper.stamp(&temp_file)?); remove_file(&temp_file)?; assert_ne!(stamp, stamper.stamp(&temp_file)?); Ok(()) } #[test] fn test_modified_file_stamper() -> Result<(), io::Error> { let stamper = FileStamper::Modified; let temp_file = create_temp_file()?; let stamp = stamper.stamp(&temp_file)?; assert_eq!(stamp, stamper.stamp(&temp_file)?); - write(&temp_file, format!("{:?}", stamp))?;
+ // Write until file modified time changes. Required on some OSs due to imprecise modified timer causing the modified + // stamp to be the same after fast consecutive writes.
+ write_until_modified(&temp_file, format!("{:?}", stamp))?; let new_stamp = stamper.stamp(&temp_file)?; assert_ne!(stamp, new_stamp); let stamp = new_stamp; remove_file(&temp_file)?; assert_ne!(stamp, stamper.stamp(&temp_file)?); Ok(()) } #[test] fn test_inconsequential_output_stamper() { let stamper = OutputStamper::Inconsequential; let stamp = stamper.stamp(&1); assert_eq!(stamp, stamper.stamp(&1)); assert_eq!(stamp, stamper.stamp(&2)); } #[test] fn test_equals_output_stamper() { Now we use write_until_modified to write to the file, ensuring its modified time will change, ensuring the stamp will change when it should. Run cargo test to confirm the stamp implementation, which should succeed now.

