Create the pie/src/dependency.rs file and add: use std::fmt::Debug;
use std::fs::File;
use std::io;
use std::path::PathBuf; use crate::{Context, Task};
use crate::fs::open_if_file;
use crate::stamp::{FileStamp, FileStamper, OutputStamp, OutputStamper}; #[derive(Clone, Eq, PartialEq, Debug)]
pub struct FileDependency { path: PathBuf, stamper: FileStamper, stamp: FileStamp,
} impl FileDependency { /// Creates a new file dependency with `path` and `stamper`, returning: /// - `Ok(file_dependency)` normally, /// - `Err(e)` if stamping failed. #[allow(dead_code)] pub fn new(path: impl Into<PathBuf>, stamper: FileStamper) -> Result<Self, io::Error> { let path = path.into(); let stamp = stamper.stamp(&path)?; let dependency = FileDependency { path, stamper, stamp }; Ok(dependency) } /// Creates a new file dependency with `path` and `stamper`, returning: /// - `Ok((file_dependency, Some(file)))` if a file exists at given path, /// - `Ok((file_dependency, None))` if no file exists at given path (but a directory could exist at given path), /// - `Err(e)` if stamping or opening the file failed. pub fn new_with_file(path: impl Into<PathBuf>, stamper: FileStamper) -> Result<(Self, Option<File>), io::Error> { let path = path.into(); let stamp = stamper.stamp(&path)?; let file = open_if_file(&path)?; let dependency = FileDependency { path, stamper, stamp }; Ok((dependency, file)) } /// Checks whether this file dependency is inconsistent, returning: /// - `Ok(Some(stamp))` if this dependency is inconsistent (with `stamp` being the new stamp of the dependency), /// - `Ok(None)` if this dependency is consistent, /// - `Err(e)` if there was an error checking this dependency for consistency. pub fn is_inconsistent(&self) -> Result<Option<FileStamp>, io::Error> { let new_stamp = self.stamper.stamp(&self.path)?; if new_stamp == self.stamp { Ok(None) } else { Ok(Some(new_stamp)) } }
} A FileDependency stores the path the dependency is about, the stamper used to create a stamp for this dependency, and the stamp that was created at the time the file dependency was made. The FileDependency::new_with_file function also returns the opened file if it exists, so that users of this function can read from the file without having to open it again. A file dependency is inconsistent when the stored stamp is not equal to a stamp that we create at the time of checking, implemented in FileDependency::is_inconsistent. For example, if we created a file dependency (with modified stamper) for a file that was modified yesterday, then modify the file, and then call is_inconsistent on the file dependency, it would return Some(new_stamp) indicating that the dependency is inconsistent. We implement an is_inconsistent method here instead of an is_consistent method, so that we can return the changed stamp when the dependency is inconsistent, which we will use for debug logging purposes later. Creating and checking a file dependency can fail due to file operations failing (for example, cannot access the file), so we propagate those errors.

