Task dependencies are implemented in a similar way. Add to pie/src/dependency.rs: #[derive(Clone, Eq, PartialEq, Debug)]
pub struct TaskDependency<T, O> { task: T, stamper: OutputStamper, stamp: OutputStamp<O>,
} impl<T: Task> TaskDependency<T, T::Output> { pub fn new(task: T, stamper: OutputStamper, output: T::Output) -> Self { let stamp = stamper.stamp(output); Self { task, stamper, stamp } } /// Checks whether this task dependency is inconsistent, returning: /// - `Some(stamp)` if this dependency is inconsistent (with `stamp` being the new stamp of the dependency), /// - `None` if this dependency is consistent. pub fn is_inconsistent<C: Context<T>>(&self, context: &mut C) -> Option<OutputStamp<T::Output>> { let output = context.require_task(&self.task); let new_stamp = self.stamper.stamp(output); if new_stamp == self.stamp { None } else { Some(new_stamp) } }
} A TaskDependency stores the task the dependency is about, along with its stamper and stamp that is created when the dependency is created. Task dependencies are generic over the type of tasks T, and their type of outputs O. Trait bounds on structs We chose not to put a Task trait bound on TaskDependency, and instead put the bound on the impl. There are several up and downsides that should be considered when making such a decision. The main upside for putting the Task bound on the TaskDependency struct, is that we can leave out O and use OutputStamp<T::Output> as the type of the stamp field. This cuts down a generic parameter, which reduces boilerplate. The downside is that we need to then put the Task bound on every struct that uses TaskDependency, which increases boilerplate. In this case, we chose not to put the trait bound on the struct to prevent that trait bound from bubbling up into other structs that use TaskDependency, as it would need to appear in almost every struct in the library. A task dependency is inconsistent if, after recursively checking it, its stamp has changed, implemented in TaskDependency::is_inconsistent. Usually, this will be using the Equals task output stamper, so a task dependency is usually inconsistent when the output of the task changes. Because we need to recursively check the task, TaskDependency::is_inconsistent requires a context to be passed in. Again, there is more mutual recursion here. This recursive consistency checking is one of the core ideas that make programmatic incremental build systems possible. But why is this so important? Why do we need recursive checking? Well, we want our build system to be sound , meaning that we must execute all tasks that are affected by a change. When we do not execute a task that is affected by a change , we are unsound , and introduce an incrementality bug ! Because of dynamic dependencies, a change in a leaf in the dependency tree may affect a task at the root. For example, a compilation task depends on a task that reads a configuration file, which depends on the configuration file. A change to a configuration file (leaf) affects a task that reads the configuration file, which in turn affects the compilation task (root). Therefore, we need to recursively check the dependency tree in order to execute all tasks affected by changes. A different way to think about this, is to think about the invariant of the dependency consistency checking. The invariant is that a dependency is consistent if and only if the subtree of that dependency is consistent, and the dependency itself is consistent. The easiest way to adhere to this invariant, is recursive checking. A final note about recursive checking is that tasks can be executed during it, and executing task can lead to new dynamic dependencies. However, recursive checking handles this without problems because these dependencies are created through the Context, which in turn will call is_inconsistent when needed.

