Finally, we create a Dependency enum that abstracts over these two kinds of dependencies. Add to pie/src/dependency.rs: #[derive(Clone, Eq, PartialEq, Debug)]
pub enum Dependency<T, O> { RequireFile(FileDependency), RequireTask(TaskDependency<T, O>),
} #[derive(Clone, Eq, PartialEq, Debug)]
pub enum InconsistentDependency<O> { File(FileStamp), Task(OutputStamp<O>),
} impl<T: Task> Dependency<T, T::Output> { /// Checks whether this dependency is inconsistent, returning: /// - `Ok(Some(stamp))` if the dependency is inconsistent (with `stamp` being the new stamp of the dependency), /// - `Ok(None)` if the dependency is consistent, /// - `Err(e)` if there was an error checking the dependency for consistency. pub fn is_inconsistent<C: Context<T>>(&self, context: &mut C) -> Result<Option<InconsistentDependency<T::Output>>, io::Error> { let option = match self { Dependency::RequireFile(d) => d.is_inconsistent()? .map(|s| InconsistentDependency::File(s)), Dependency::RequireTask(d) => d.is_inconsistent(context) .map(|s| InconsistentDependency::Task(s)), }; Ok(option) }
} Dependency just merges the two kinds of dependencies and provides an is_inconsistent method that calls the corresponding method. We return the changed stamp here as well for debug logging later. We wrap the changed stamp in an InconsistentDependency enum, and map to the correct variant if there is an inconsistency. Because Dependency can store a TaskDependency, we need to propagate the T and O generics. Likewise, InconsistentDependency propagates the O generic for OutputStamp. User-defined dependencies Like with stampers, Dependency could also be a trait to allow users of the library to define their own dependencies. However, as we will see later, these dynamic dependencies also require validation, and I am unsure how such a Dependency trait should look. Therefore, we don't have an appendix on how to implement this. But, if you have an idea on how to this nicely (after you've completed this tutorial), please get in touch!

