Add the store module to pie/src/lib.rs: pub mod stamp; pub mod context; mod fs; mod dependency;
+mod store; /// A unit of computation in a programmatic incremental build system. pub trait Task: Clone + Eq + Hash + Debug { /// Type of output this task returns when executed. type Output: Clone + Eq + Debug; This module is private, as users of the library should not interact with the store. Only Context implementations will use the store. Create the pie/src/store.rs file and add the following to get started: use std::path::{Path, PathBuf}; use pie_graph::{DAG, Node}; use crate::dependency::{Dependency, FileDependency, TaskDependency};
use crate::Task; /// Stores files and tasks, and their dependencies, in a DAG (directed acyclic graph). Provides operations to mutate
/// and query this graph.
pub struct Store<T, O> { graph: DAG<NodeData<T, O>, Dependency<T, O>>,
} #[derive(Debug)]
enum NodeData<T, O> { File(PathBuf), Task { task: T, output: Option<O>, },
} impl<T: Task> Default for Store<T, T::Output> { fn default() -> Self { Self { graph: DAG::default(), } }
} The Store is generic over tasks T and their outputs O, like we have done before with Dependency. The DAG type from pie_graph represents a DAG with nodes and edges, and data attached to those nodes and edges. The nodes in our graph are either files or tasks, and the edges are dependencies. The first generic argument to DAG is the type of data to attach to nodes, which is NodeData<T, O> in our case. Because nodes can be files or tasks, NodeData<T, O> enumerates these, storing the path for files, and the task along with its output for tasks. We store file paths as PathBuf, which is the owned version of Path (similar to String being the owned version of str). The task output is stored as Option<O> because we can add a task to the graph without having executed it, so we don't have its output yet. The second argument is the type of data to attach to edges, which is Dependency<T, O>, using the Dependency enum we defined earlier. We implement Default for the store to initialize it. Deriving default We cannot derive this Default implementation even though it seems we should be able to, because the derived implementation will require T and O to be Default, and this is not always the case. This is because the Default derive macro is conservative and adds a : Default bound to every generic argument in the Default trait implementation, and there is no way to disable this behaviour. Therefore, we implement Default ourselves. There are several crates that have more configurable derive macros for these things, but adding an extra dependency to generate a few lines of code is not worth the extra compilation time, so we just implement it manually here.

