A node in DAG is represented by a Node, which is a transparent identifier (sometimes called a handle) that points to the node and its data. We can create nodes in the graph, and then query attached data (NodeData) given a node. So DAG allows us to go from Node to a PathBuf and task T through attached NodeData. However, we want each unique file and task to be represented by a single unique node in the graph. We need this for incrementality so that if the build system encounters the same task twice, we can find the corresponding task node in the graph the second time, check if it is consistent, and return its output if it is. To ensure unique nodes, we need to maintain the reverse mapping from PathBuf and T to Node ourselves, which we will do with HashMaps. This is also the reason for the Eq and Hash trait bounds on the Task trait, so we can use them as keys in HashMaps. Change pie/src/store.rs to add hash maps to map between these things: +use std::collections::HashMap; use std::path::{Path, PathBuf}; use pie_graph::{DAG, Node}; use crate::dependency::{Dependency, FileDependency, TaskDependency}; use crate::Task; /// Stores files and tasks, and their dependencies, in a DAG (directed acyclic graph). Provides operations to mutate /// and query this graph. pub struct Store<T, O> { graph: DAG<NodeData<T, O>, Dependency<T, O>>,
+ file_to_node: HashMap<PathBuf, Node>,
+ task_to_node: HashMap<T, Node>, } #[derive(Debug)] enum NodeData<T, O> { File(PathBuf), Task { task: T, output: Option<O>, }, } impl<T: Task> Default for Store<T, T::Output> { fn default() -> Self { Self { graph: DAG::default(),
+ file_to_node: HashMap::default(),
+ task_to_node: HashMap::default(), } } } To prevent accidentally using a file node as a task node, and vice versa, change pie/src/store.rs to add specific types of nodes: +use std::borrow::Borrow; use std::collections::HashMap; use std::path::{Path, PathBuf}; use pie_graph::{DAG, Node}; use crate::dependency::{Dependency, FileDependency, TaskDependency}; use crate::Task; /// Stores files and tasks, and their dependencies, in a DAG (directed acyclic graph). Provides operations to mutate /// and query this graph. pub struct Store<T, O> { graph: DAG<NodeData<T, O>, Dependency<T, O>>,
- file_to_node: HashMap<PathBuf, Node>,
- task_to_node: HashMap<T, Node>,
+ file_to_node: HashMap<PathBuf, FileNode>,
+ task_to_node: HashMap<T, TaskNode>, } #[derive(Debug)] enum NodeData<T, O> { File(PathBuf), Task { task: T, output: Option<O>, }, } +/// Newtype for file `Node`s.
+#[repr(transparent)]
+#[derive(Clone, Copy, PartialEq, Eq, PartialOrd, Ord, Hash, Debug)]
+pub struct FileNode(Node);
+
+impl Borrow<Node> for &FileNode {
+ fn borrow(&self) -> &Node { &self.0 }
+}
+
+/// Newtype for task `Node`s.
+#[repr(transparent)]
+#[derive(Clone, Copy, PartialEq, Eq, PartialOrd, Ord, Hash, Debug)]
+pub struct TaskNode(Node);
+
+impl Borrow<Node> for &TaskNode {
+ fn borrow(&self) -> &Node { &self.0 }
+}
+ impl<T: Task> Default for Store<T, T::Output> { fn default() -> Self { Self { graph: DAG::default(), file_to_node: HashMap::default(), task_to_node: HashMap::default(), } } } The FileNode and TaskNode types are newtypes that wrap a Node into a specific type of node. The Borrow implementations will make subsequent code a bit more concise by automatically converting &FileNode and &TaskNodes to &Nodes. Newtypes Because the Nodes inside the newtypes are not public, it is not possible to construct a FileNode or TaskNode outside of this module. Therefore, if we only accept and create FileNode and TaskNode in the Store API, it is not possible to use the wrong kind of node. The Borrow implementation does leak outside of this module, but not outside of this crate (library). This is because the visibility of a trait implementation is the intersection of the visibilities of the trait and type it is implemented on. Borrow is public, but FileNode and TaskNode are only public within this crate. Thefore, modules of this crate can extract the Node out of FileNode and TaskNode. However, that Node cannot be used to construct a FileNode or TaskNode, so it is not a problem. Now we will add methods create nodes and to query their attached data. Add the following code to pie/src/store.rs: impl<T: Task> Store<T, T::Output> { /// Gets the file node for `path`, or creates a file node by adding it to the dependency graph. pub fn get_or_create_file_node(&mut self, path: impl AsRef<Path>) -> FileNode { let path = path.as_ref(); if let Some(file_node) = self.file_to_node.get(path) { *file_node } else { let node = self.graph.add_node(NodeData::File(path.to_path_buf())); let node = FileNode(node); self.file_to_node.insert(path.to_path_buf(), node); node } } /// Gets the path for `node`. /// /// # Panics /// /// Panics if `node` was not found in the dependency graph. #[allow(dead_code)] pub fn get_file_path(&self, node: &FileNode) -> &PathBuf { let Some(NodeData::File(path)) = self.graph.get_node_data(node) else { panic!("BUG: node {:?} was not found in the dependency graph", node); }; path } /// Gets the task node for `task`, or creates a task node by adding it to the dependency graph. pub fn get_or_create_task_node(&mut self, task: &T) -> TaskNode { if let Some(node) = self.task_to_node.get(task) { *node } else { let node = self.graph.add_node(NodeData::Task { task: task.clone(), output: None, }); let node = TaskNode(node); self.task_to_node.insert(task.clone(), node); node } } /// Gets the task for `node`. /// /// # Panics /// /// Panics if `node` was not found in the dependency graph. pub fn get_task(&self, node: &TaskNode) -> &T { let Some(NodeData::Task { task, .. }) = self.graph.get_node_data(node) else { panic!("BUG: node {:?} was not found in the dependency graph", node); }; task }
} The get_or_create_file_node method creates file nodes. When we want to go from a file path (using impl AsRef<Path>) to a FileNode, either we have already added this file path to the graph and want to get the FileNode for it, or we have not yet added it to the graph yet and should add it. The former is handled by the if branch in get_or_create_file_node, where we just retrieve the FileNode from the file_to_node hash map. The latter is handled by the else branch where we add the node to the graph with graph.add_node which attaches the NodeData::File data to the node, and then returns a FileNode which we insert into the file_to_node map. The get_file_path method does the inverse. We get the attached data given a node, and extract the file path from it. Note that we are using panic! here to indicate that invalid usage of this method is an unrecoverable programming error that should not occur. Returning an Option<&PathBuf> makes no sense here, as the caller of this method has no way to recover from this. Because this is not an end-user-facing API (store module is private), we control all the calls to this method, and thus we are responsible for using these methods in a valid way. Therefore, when we call these methods, we should document why it is valid (if this is not immediately obvious), and we need to test whether we really use it in a valid way. We're also documenting the panics in a # Panics section in the documentation comment, as is common practice in Rust. Triggering these panics Because only Store can create FileNodes and TaskNodes, and all methods only take these values as inputs, these panics will not happen under normal usage. The only way to trigger these panics (in safe Rust) would be to create two stores, and use the nodes from one store in another. However, since this is a private module, we just need to make sure that we don't do that. There are some tricks to prevent even this kind of invalid usage. For example, the generativity crate generates unique identifiers based on lifetimes. However, that is a bit overkill, especially for an internal API, so we won't be using that. We implement similar methods for task nodes in get_or_create_task_node and get_task.

