ic will immediately abort the program. When panics unwind, the call stack is unwound, which still runs all destructors ( Drop), and this unwinding can be caught. We can catch unwinding panics with catch_unwind, which is a way to recover from panics. This does require that the types used in the closure passed to catch_unwind are unwind safe. This is because panics exit a function early, which can mess up some invariants of your code. For example, a call to set a task output can be skipped when a panic occurs, breaking a code invariant. Therefore, types such as &mut T are not unwind safe by default, because these invariants can break under panics. Note that unwind safety is something different than the general safety guarantees provided by Rust: type-safe, memory-safe, thread-safe. An unwind unsafe type is still type-safe, memory-safe, and thread-safe. Unwind safety can be more easily achieved by using owned types which run destructors when the function call ends, which work under normal circumstances, but also when unwinding panics. In the context of the PIE build system, if we panic on unrecoverable errors, but want to allow catching these panics, we need to think about unwind safety. At any point we panic, we need to think about keeping the system in a valid state. Another way to recover from panics is to run the panicking code on a different thread. If the code panics, it will only end that thread, effectively allowing panic recovery. However, this does require some form of thread-safety, beause you are moving a computation to a different thread. Furthermore, some platforms do not have access to threads, such as WASM, where this approach would not work. A final note is that care must be taken when unwiding panics across foreign function interfaces (FFI).

