+impl<T: Task> TopDownContext<T, T::Output> {
+ /// Checks whether given task should be executed, returning `true` if it should be executed. A task should be executed
+ /// if any of its dependencies are inconsistent, or when it has no output.
+ fn should_execute_task(&mut self, node: &TaskNode) -> bool {
+ // Borrow: because we pass `self` (which is `&mut self`) to `is_inconsistent` for recursive consistency checking, + // we need to clone and collect dependencies into a `Vec`. Otherwise we have an immutable borrow of `self`
+ // through `self.store` while we create a mutable borrow of `self`, which is not allowed.
+ let dependencies: Vec<_> = self.store.get_dependencies_of_task(node).cloned().collect();
+ for dependency in dependencies {
+ match dependency.is_inconsistent(self) {
+ Ok(Some(_)) => return true,
+ _ => {} // Consistent: continue checking
+ }
+ }
+ // Task has no dependencies or all dependencies are consistent. Should only execute if it has no output, meaning
+ // that it has never been executed before.
+ return !self.store.task_has_output(node);
+ }
+} The premise of should_execute_task is simple: go over the dependencies of a task until dependency.is_inconsistent is true, at which we return true. If all dependencies are consistent, then return true only if the task has no output. Otherwise, return false. However, there are some complications due to borrowing. Checking if a task dependency is inconsistent requires recursive checking: TaskDependency::is_inconsistent requires a &mut Context to call Context::require_task, which in turn can require this method again. To that end, we pass self to is_inconsistent, because self is an instance of TopDownContext which implements Context. In this method, self is &mut self, a mutable borrow. Therefore, we cannot have any other borrows active while is_inconsistent is being called, because that would violate one of the safety mechanisms of Rust where mutable borrows are exclusive . Getting the task's dependencies from the store requires a borrow, so we cannot hold onto that borrow. We get around that here by cloning the dependencies and collecting them into a Vec. We also document this fact in a comment to explain to readers (us in the future) why we do this cloning, preventing refactorings only to hit that same borrowing issue again. Cloning and collecting does have a performance overhead as we need to clone the dependencies and heap allocate a Vec to store them. For this tutorial, that is fine, but in a real-world application we should minimize cloning if possible and look into reducing heap allocations. Reference counting Cloning a Dependency results in heap allocations, because cloning FileDependency clones a PathBuf which is a heap allocated string (basically a Vec<u8>), and cloning a TaskDependency clones the Task, which may require allocations as well. One way to avoid heap allocations in both kinds of dependencies is to store the PathBuf and Task in a reference-counting pointer Rc. Then, there will only be one heap allocated PathBuf and Task, and cloning just increments the reference count. The upside is that this approach is easy to implement and reduces allocations. The downside is that clones require incrementing the reference count, which is a write operation that does have a tiny bit of overhead. In many cases, this overhead is smaller than cloning data when the data is large enough or requires heap allocations. In our case, it would probably be worth doing this, but benchmarking is required to confirm this. Note that instead of always wrapping tasks in a Rc, task authors could implement Task on Rc<TheirTask> instead. Since Rc implements Clone, any time we task.clone(), we would just increase the reference count instead. When working in a multi-threaded situation, you would use the thread-safe Arc instead. String optimizations A technique for reducing allocations on strings (and string-like types such as PathBuf) is to apply small string optimization, where small strings are stored inline instead of requiring a heap allocation. This only works if the strings are usually small enough to fit inline on the stack (for example, 32 bytes). Another technique for strings is string interning, where equal strings are stored in a central place and then re-used everywhere. This technique is great when we use the same string a lot of times. That may be a good strategy for a build system, where we work with the same file paths over and over. There are several crates implementing these techniques, but I have not used one myself yet, so I cannot recommend one. Avoiding heap allocations from collecting into Vecs Collecting the elements of an iterator into a Vec requires heap allocations as Vec is allocated on the heap. We can avoid or at least reduce the number of heap allocations by re-using the same Vec instead of creating a new one. Instead of collecting, you would store the Vec in the struct, clear it, and then extend it with the iterator. When you clear a Vec, it removes all the elements, but keeps the heap allocated space. Only if you would add more elements than it has space for, another heap allocation would be required, which will happen less and less frequently when you keep reusing the same Vec. The downside is that you are keeping this heap allocated space for as long as you keep reusing the same Vec, which could waste some memory, but usually this is not a big problem. You could of course call vec.shrink_to_fit() after not using it for a while to free up this space. However, we cannot apply this technique here, because if we store the Vec in TopDownContext, we would run into the same borrowing problem again. This technique also requires that you have mutable access to the Vec in order to mutate it. Both of these limitations can be overcome by using a Cell. Cell allows mutation to its inner value in an immutable context. The catch is that you cannot get a reference to its inner value , you can only take the value out, mutate it, and then set it back. Unfortunately, even this technique cannot be fully applied to should_execute_task, because it is called recursively and therefore the Cell will be empty when we try to take the Vec out. If we want to avoid heap allocations from collecting new Vecs in should_execute_task, we would need to come up with a creative solution. But this is outside of the scope of even this extra information block, so we'll just leave it at that. Finally, we need to do something with dependency checking failures. We've ignored the case where dependency.is_inconsistent returns Err. When dependency checking result in an error, we should store the error for the user to investigate, and assume the dependency is inconsistent. Change pie/src/context/mod.rs to store dependency check errors and give users access to it: use crate::store::{Store, TaskNode}; pub struct TopDownContext<T, O> { store: Store<T, O>, current_executing_task: Option<TaskNode>,
+ dependency_check_errors: Vec<io::Error>, } impl<T: Task> Default for TopDownContext<T, T::Output> { fn default() -> Self { Self { store: Store::default(), current_executing_task: None,
+ dependency_check_errors: Vec::default(), } } } impl<T: Task> TopDownContext<T, T::Output> { pub fn new() -> Self { Self::default() }
+
+ pub fn get_dependency_check_errors(&self) -> impl Iterator<Item=&io::Error> {
+ self.dependency_check_errors.iter()
+ } } impl<T: Task> Context<T> for TopDownContext<T, T::Output> { fn require_file_with_stamper<P: AsRef<Path>>(&mut self, path: P, stamper: FileStamper) -> Result<Option<File>, io::Error> { And then change pie/src/context/mod.rs to store these errors: // through `self.store` while we create a mutable borrow of `self`, which is not allowed. let dependencies: Vec<_> = self.store.get_dependencies_of_task(node).cloned().collect(); for dependency in dependencies { match dependency.is_inconsistent(self) { Ok(Some(_)) => return true,
+ Err(e) => { // Error while checking: store error and assume inconsistent
+ self.dependency_check_errors.push(e);
+ return true;
+ } _ => {} // Consistent: continue checking } } // Task has no dependencies or all dependencies are consistent. Should only execute if it has no output, meaning // that it has never been executed before. It took us a while, but now we've implemented an incremental build system with dynamic dependencies 🎉. Let's set up an example to see the fruits of our labour.

