Create the pie/examples directory, and create the pie/examples/incrementality.rs file with the following contents: #![allow(unused_imports, unused_variables)] use std::fs::{File, read_to_string, remove_file, write};
use std::io::{self, Read, Write};
use std::path::{Path, PathBuf}; use dev_shared::{create_temp_dir, write_until_modified};
use pie::{Context, Task};
use pie::context::top_down::TopDownContext;
use pie::stamp::FileStamper; /// Enumeration over file pseudo-tasks.
#[derive(Clone, Ord, PartialOrd, Eq, PartialEq, Hash, Debug)]
enum FileTask { ReadStringFromFile(ReadStringFromFile), WriteStringToFile(WriteStringToFile),
} /// [`Task`] implementation for [`FileTask`], forwarding execute to the execute functions of the pseudo-tasks.
impl Task for FileTask { type Output = Result<String, io::ErrorKind>; fn execute<C: Context<Self>>(&self, context: &mut C) -> Self::Output { match self { FileTask::ReadStringFromFile(t) => t.execute(context), FileTask::WriteStringToFile(t) => t.execute(context).map(|_| String::new()) } }
} FileTask is the enum over the ReadStringFromFile and WriteStringToFile "pseudo-tasks" that we still need to define. We call these types pseudo-tasks, because they behave like tasks, but do not actually implement Task. We implement Task on FileTask instead, which forwards the execute method to the pseudo-tasks. Both tasks can fail due to using filesystem operations, so the output is a Result. We cannot use std::io::Error as the error in the Result, because it does not implement Clone nor Eq, which need to be implemented for task outputs. Therefore, we use std::io::ErrorKind which does implement these traits. On success, we return a String. Because WriteStringToFile will not return a value (i.e., ()) on success, we return an empty string with String::new(). It would be cleaner to define an FileOutput enum that enumerates the possible outputs of file tasks, which would include a variant for WriteStringToFile returning (). But to keep this example simple we don't do that.

