Now add ReadStringFromFile to pie/examples/incrementality.rs: /// Pseudo-task that reads a string from a file.
#[derive(Clone, Ord, PartialOrd, Eq, PartialEq, Hash, Debug)]
struct ReadStringFromFile(PathBuf, FileStamper); impl ReadStringFromFile { fn new(path: impl AsRef<Path>, stamper: FileStamper) -> FileTask { FileTask::ReadStringFromFile(Self(path.as_ref().to_path_buf(), stamper)) } fn execute<C: Context<FileTask>>(&self, context: &mut C) -> Result<String, io::ErrorKind> { println!("Reading from {} with {:?} stamper", self.0.display(), self.1); let file = context.require_file_with_stamper(&self.0, self.1).map_err(|e| e.kind())?; if let Some(mut file) = file { let mut string = String::new(); file.read_to_string(&mut string).map_err(|e| e.kind())?; Ok(string) } else { Err(io::ErrorKind::NotFound) } }
} We've already defined a task like this before, but now it accepts a FileStamper, prints something when it gets executed, and propagates errors. Add WriteStringToFile to pie/examples/incrementality.rs: /// Pseudo-task that writes a string to a file, where the string is provided by another task. The string provider is /// boxed to prevent a cyclic definition of infinite size, due to this type being used in [`FileTask`].
#[derive(Clone, Ord, PartialOrd, Eq, PartialEq, Hash, Debug)]
struct WriteStringToFile(Box<FileTask>, PathBuf, FileStamper); impl WriteStringToFile { fn new(string_provider: impl Into<Box<FileTask>>, path: impl Into<PathBuf>, stamper: FileStamper) -> FileTask { FileTask::WriteStringToFile(Self(string_provider.into(), path.into(), stamper)) } fn execute<C: Context<FileTask>>(&self, context: &mut C) -> Result<(), io::ErrorKind> { println!("Writing output of {:?} to {} with {:?} stamper", self.0, self.1.display(), self.2); let string = context.require_task(&self.0)?; let mut file = File::create(&self.1).map_err(|e| e.kind())?; file.write_all(string.as_bytes()).map_err(|e| e.kind())?; context.require_file_with_stamper(&self.1, self.2).map_err(|e| e.kind())?; Ok(()) }
} What is special about this task, is that it takes another task as input! Tasks in a programmatic incremental build system are first-class, meaning that they are just values that can be passed around. This is similar to closures in Rust and other programming languages, which are functions (with some values captured from the environment), but are also values that can be passed around. Tasks can therefore be seen as a form of incremental closures, although they need to be executed under a Context for incrementality, whereas closures are more free-form. WriteStringToFile requires the task to (incrementally) get the string, creating a task dependency. Then it writes that string to a file, and requires that file to create a file dependency. Boxing to prevent cyclic definition We store the task as Box<FileTask> in order to prevent a cyclic definition, which would cause FileTask to have an undetermined size. This is due to several reasons: In Rust, values are stored on the stack by default. To store something on the stack, Rust needs to know its size at compile-time . The size of an enum is the size of the largest variant. The size of a struct is the sum of the size of the fields. If we don't box the task, to calculate the size of WriteStringToFile, we need to calculate the size of FileTask, which would require calculating the size of WriteStringToFile, and so forth. Therefore, we can't calulate the size of WriteStringToFile and FileTask, which is an error. Boxing solves this because Box<FileTask> allocates a FileTask on the heap, and then creates a pointer to it. Therefore, the size of Box<FileTask> is the size of one pointer, breaking the cycle in the size calculations. Note that this explanation simplifies many aspects of Rust's size calculation.

