To check whether we need to execute a task, we need to check the dependencies of that task to see if any of them are inconsistent. To make this consistency checking configurable, we will use stamps. A dependency is inconsistent if after stamping, the new stamp is different from the old stamp. Therefore, we will implement a FileStamper that stamps files and produces a FileStamp, and an OutputStamper that stamps task outputs and produces an OutputStamp. Add the stamp module to pie/src/lib.rs: use std::fs::File; use std::hash::Hash; use std::io; use std::path::Path; +pub mod stamp; pub mod context; mod fs; /// A unit of computation in a programmatic incremental build system. pub trait Task: Clone + Eq + Hash + Debug {
@@ -22,8 +23,9 @@ /// so that the dependency corresponds to the data that you are reading. Returns: /// - `Ok(Some(file))` if a file exists at given `path`, /// - `Ok(None)` if no file exists at given `path` (but a directory could exist at given `path`), /// - `Err(e)` if there was an error getting the metadata for given `path`, or if there was an error opening the file. fn require_file<P: AsRef<Path>>(&mut self, path: P) -> Result<Option<File>, io::Error>;
+ /// Requires given `task`, recording a dependency and selectively executing it. Returns its up-to-date output. fn require_task(&mut self, task: &T) -> T::Output; } This module is public as users of the library will construct stampers.
